import React, { useState, useEffect, useContext } from "react";

import { Context } from '../Context';
import Navbar from "../Navbar";
import useStyles from '../styles';

function Account() {
  const {
    accountState,
    setAccountState,
    getAccountInfo
  } = useContext(Context);

  const {
    employee_id,
    username,
    first_name,
    last_name,
    email,
  } = accountState;

  useEffect(() => {
    //function to retrieve questions
    getAccountInfo();
  }, []);

  const [checkboxState, setCheckboxState] = React.useState({
    checkedA: true,
    checkedB: true,
    checkedF: true,
    checkedG: true,
  });

  const styles = useStyles();

  const handleCheckboxChange = (event) => {
    setCheckboxState({ ...checkboxState, [event.target.name]: event.target.checked });
  };

  return (
    <main className={styles.main}>
      <Navbar />
      <br />
      <Typography variant="h3" align='center'>Account</Typography>
      <br />
      <Typography align='center'>Employee ID: {employee_id}</Typography>
      <Typography align='center'>Username: {username}</Typography>
      <Typography align='center'>First Name: {first_name}</Typography>
      <Typography align='center'>Second Name: {last_name}</Typography>
      <Typography align='center'>Email: {email}</Typography>
    </main>
  );
}

export default Account;
